import styled from "styled-components";
import { Colors, TextStyles } from "../../Theme";

const Button = styled.button`
  border: none;
  padding: 0.5rem 1rem;
  transition-property: background-color, color, border-color;
  transition-duration: 0.3s;
  border-radius: 100px;
  cursor: pointer;
`;
export default Button;
